How’s your corn doing? 

@nkseeds_us 🌽 pulled through the initial drought after planting and the excessive rain recently! Love me a resilient crop! (Taller than me now, I’m 5’10”) 

#NKpartner

We can finally announce something BIG that we have been planning! (Please SHARE! ❤️) 

You are now formally invited to our “For the Farmers Formal” September 22nd at 7pm!  All proceeds of this event will be going to @nyfarmnet and the @newyorkagriculturallandtrust to support NY farms and families. 

Tickets are on sale in the link in our bio! **and there are only 275 available so get yours before they sell out!** 

Dress in your best for our black tie event! There will be live music by the @theswampboyss, food, drinks, and a LIVE AUCTION! Come out to support NY farm and farm families, meet us (🫶🏼), and have a fun filled night!

